(49, 'To sports man...', 'To sports man ariving to the aligning to jio camp to aligning..', 'news_1738815053.jpg', 'Anil jha', '2025-01-30 11:02:04', 0, '2025-01-30 11:02:04', '2', 19, '', '5', 'approved', NULL, '', ''),
