(51, 'Sky Force Day 7 Box Office Trends: ', 'Sky Force Goes In Risky Mode; To Compete With Deva\r\nBacked by Maddock Films and Jio Studios, Sky Force maintained great hold in the opening weekend due to movie offers of heavy discounted prices for the tickets. Akshay Kumar and Veer Pahariya-starrer collected Rs 64 crore at the box office in the first three days of its release. The aerial actioner then witnessed drop during the weekdays, bringing its cume collection to Rs 82.25 crore in six days.', 'news_1738819676.jpg', 'Anil jha', '2025-01-30 11:04:29', 0, '2025-01-30 11:04:29', '1', 31, '', '6', 'approved', NULL, '', ''),
(52, 'Top 3 Exercises For A Healthy Heart', 'Aerobic, cardio or cardiovascular exercises help keep your heart, lungs and circulatory system healthy. Aerobic exercises strengthen your heart muscles and allow it to pump blood efficiently. This improves blood flow to different parts of the body. These exercises get your blood pumping and involve large muscle groups.', 'news_1738988815.jpg', 'Anil jha', '2025-01-30 11:06:11', 0, '2025-01-30 11:06:11', '2', 59, '', '7', 'approved', NULL, '', ''),
(53, 'GAIL Q3 results: Net profit rises 28% to ₹4,084 crore, revenue at ₹36,937 crore', 'GAIL (India), on January 30, announced a consolidated net profit of ₹4,084 crore for the third quarter of the 2024-25 financial year, marking a 28 per cent rise from the previous year.', 'news_1738988475.jpg', 'Anil jha', '2025-01-30 11:07:30', 0, '2025-01-30 11:07:30', '3', 45, '', '1', 'approved', NULL, '', ''),
(54, 'GAIL Q3 income and EBITDA', 'GAIL reported an exceptional income of $285 million, or ₹2,440 crore, for the quarter from SEFE Marketing & Trading Singapore Pte. Ltd. as a settlement for the withdrawal of arbitration proceedings, according to Sandeep Kumar Gupta, Chairman and Managing Director.', 'news_1738819676.jpg', 'Anil jha', '2025-01-30 11:25:25', 0, '2025-01-30 11:25:25', '2', 54, '', '8', 'approved', NULL, '', '');
